import React from "react";



const Article = () => {

    return (

        <div className={styles.Article}>
            <span className={styles.item1}> Курс валют на 18 декабря 2019 </span>
            <span className={styles.item1}>USD </span>
            <span className={styles.item2}>USD </span>

        </div>


    )
}

export default Article
